import React from "react"
import { Link } from "react-router-dom"
import "./css/NavbarStyle.css"


export default function Navbar() {

  const handleClickScroll = () => {
    const element = document.getElementById('section-1');
    if (element) {
      // ðŸ‘‡ Will scroll smoothly to the top of the next section
      element.scrollIntoView({ behavior: 'smooth' });
    }
  };

  return (
    <div>
        
        <header >

            
            <ul  className="right">
                <li><Link onClick={handleClickScroll} to='/intro'>  Intro</Link></li>
                <li><Link onClick={handleClickScroll} to='/Coaches'> Coaches</Link></li>
                <li><Link onClick={handleClickScroll} to='/insctiption'> Inscription</Link></li>
                <li><Link to='#notes'> Notes  </Link></li>
                <li><Link to='#contact'> contLinkct us  </Link></li>
            </ul>



        </header>
    </div>
  )
}
